import React from 'react';
import './SearchImage.scss';

const SearchImage = ({data, url}) => {
    console.log(data, url)
    return (
        <div className="searchimage">
            <img src={url} alt=""/>
            <span>{data.title}</span>
            <span>{data.url}</span>
        </div>
    );
}

export default SearchImage;
